const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <AuthContextProvider>
    <GlobalStyle />
    <GlobalProvider>
    <App />
    </GlobalProvider>
    </AuthContextProvider>


  </React.StrictMode>
);
